use soccer;
Drop table  if exists player;
Create table player (
id BIGINT PRIMARY KEY,
name VARCHAR(255),
firstname VARCHAR(255),
lastname VARCHAR(255),
age INT,
birth_date VARCHAR(255),
birth_place VARCHAR(255),
birth_country VARCHAR(255),
nationality VARCHAR(255),
height INT,
weight INT,
injured enum('true','false'),
photo VARCHAR(255),
team_id BIGINT,position VARCHAR(255),
rating FLOAT,
Index player_name_idx(name,firstname,lastname));
